// src/components/Header.jsx
import React from "react";
import "./Header.css";
import { FaUserCircle } from "react-icons/fa";
import { NavLink, useNavigate } from "react-router-dom";

const Header = () => {
  const navigate = useNavigate();

  return (
    <header className="md-header">
      <nav className="md-nav">
        <ul>
          <li className="brand">
            <NavLink to="/" end>
              Micro-Doppler Project
            </NavLink>
          </li>
          <li>
            <NavLink to="/description">Project Description</NavLink>
          </li>
          <li>
            <NavLink to="/research">Research Paper</NavLink>
          </li>
          <li>
            <NavLink to="/contributors">Contributors</NavLink>
          </li>
          <li>
            {/* ✅ Dataset will route to LoginPage */}
            <NavLink to="/dataset">Dataset</NavLink>
          </li>
          <li>
            <NavLink to="/feedback">Feedback</NavLink>
          </li>
        </ul>
      </nav>

      {/* ✅ Login button routes to LoginPage as well */}
      <div className="login-section">
        <button
          className="login-btn"
          onClick={() => navigate("/dataset")}
        >
          <FaUserCircle className="login-icon" />
          Login
        </button>
      </div>
    </header>
  );
};

export default Header;
